import React from 'react';

const Dummy = () => {


    return (
        <>
    <h1>Download the App to help you monitor your eye fitness and helps you remind to blink and gives you a detailed report</h1>
    <input type="button" onclick="window.open('http://www.example.com','_blank','resizable=yes')" />
    </>
    );
}

export default Dummy;
